textOriginal:
Ou seja é proibido ser honesto, é proibido falar a verdade, é proibido expressar sua opinião com responsabilidade claro. É proibido pensar, ("nem pensar nisso hein") é proibido amar a vida... É proibido ser cristão... Em fim!...
🇧🇷 --- O povo decidi; 
#Messias ou Barrabás?!...

Não pode chamar o Ladrão de 9 Dedos:

-- Ex-presidiário;

– Descondenado;

– Ladrão;

– Corrupto;

– Chefe de organização criminosa
